import React from 'react'


const Cell = (szama) => {
  return( 
  <div style={style.cellStyle}>
    <input style={style.inputStyle } placeholder={szama}></input>
  </div>
    
  )
};
const style = {
  cellStyle:{
    width:40, height:40, background: "lightgrey",
    display:'flex',
    justifyContent:'center',
    alignItems:'center',
    border: '1px solid black'  ,
    overflow: 'hidden'
  },
  inputStyle:{
    width:'100%',
    height:'100%'
  }
}
export default Cell
